agger: "2.0"
info:
  title: Genomics
  description: Upload, process, query, and search Genomics data in the cloud.
  contact:
    name: Google
    url: https://google.com
  version: v1
host: genomics.googleapis.com
basePath: /
schemes:
- http
produces:
- application/json
consumes:
- application/json
paths:
  /v1/annotations:
    post:
      summary: Create Annotation
      description: Creates a new annotation
      operationId: genomics.annotations.create
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      responses:
        200:
          description: OK
      tags:
      - Annotation
  /v1/annotations/search:
    post:
