      operationId: genomics.annotations.update
      parameters:
      - in: path
        name: annotationId
        description: The ID of the annotation to be updated
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: query
        name: updateMask
        description: An optional mask specifying which fields to update
      responses:
        200:
          description: OK
      tags:
      - Annotation
  /v1/annotations:batchCreate:
