      parameters:
      - in: path
        name: annotationSetId
        description: The ID of the annotation set to be updated
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: query
        name: updateMask
        description: An optional mask specifying which fields to update
      responses:
        200:
          description: OK
      tags:
