        200:
          description: OK
      tags:
      - Call Set
  /v1/callsets/search:
    post:
      summary: Search Call Sets
      description: Gets a list of call sets matching the criteria
      operationId: genomics.callsets.search
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      responses:
        200:
          description: OK
      tags:
      - Call Set
  /v1/callsets/{callSetId}:
    delete:
      summary: Delete Call Set
      description: Deletes a call set
      operationId: genomics.callsets.delete
      parameters:
      - in: path
        name: callSetId
        description: The ID of the call set to be deleted
      responses:
        200:
          description: OK
      tags:
      - Call Set
    get:
      summary: Get Call Set
      description: Gets a call set by ID
      operationId: genomics.callsets.get
      parameters:
      - in: path
        name: callSetId
        description: The ID of the call set
      responses:
        200:
          description: OK
      tags:
      - Call Set
    patch:
      summary: Update Call Set
      description: Updates a call set
      operationId: genomics.callsets.patch
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: callSetId
        description: The ID of the call set to be updated
      - in: query
        name: updateMask
        description: An optional mask specifying which fields to update
      responses:
        200:
          description: OK
      tags:
      - Call Set
  /v1/datasets:
    get:
      summary: Get Datasets
      description: Lists datasets within a project
      operationId: genomics.datasets.list
      parameters:
      - in: query
        name: pageSize
        description: The maximum number of results to return in a single page
      - in: query
        name: pageToken
        description: The continuation token, which is used to page through large result
          sets
      - in: query
        name: projectId
        description: Required
      responses:
        200:
          description: OK
      tags:
      - Dataset
    post:
      summary: Create Dataset
      description: Creates a new dataset
      operationId: genomics.datasets.create
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      responses:
        200:
          description: OK
      tags:
      - Dataset
  /v1/datasets/{datasetId}:
    delete:
      summary: Delete Dataset
      description: |-
        Deletes a dataset and all of its contents (all read group sets,
        reference sets, variant sets, call sets, annotation sets, etc
      operationId: genomics.datasets.delete
      parameters:
      - in: path
        name: datasetId
        description: The ID of the dataset to be deleted
      responses:
        200:
          description: OK
      tags:
      - Dataset
    get:
      summary: Get Dataset
      description: Gets a dataset by ID
      operationId: genomics.datasets.get
      parameters:
      - in: path
        name: datasetId
        description: The ID of the dataset
      responses:
        200:
          description: OK
      tags:
      - Dataset
    patch:
      summary: Update Dataset
      description: Updates a dataset
      operationId: genomics.datasets.patch
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: datasetId
        description: The ID of the dataset to be updated
      - in: query
        name: updateMask
        description: An optional mask specifying which fields to update
      responses:
        200:
          description: OK
      tags:
