  /v1/datasets/{datasetId}:undelete:
    post:
      summary: Restore Dataset
      description: Undeletes a dataset by restoring a dataset which was deleted via
        this API
      operationId: genomics.datasets.undelete
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: datasetId
        description: The ID of the dataset to be undeleted
      responses:
        200:
          description: OK
