        200:
          description: OK
      tags:
      - Variant Set
    patch:
      summary: Update Variant Set
      description: Updates a variant set using patch semantics
      operationId: genomics.variantsets.patch
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: query
        name: updateMask
        description: An optional mask specifying which fields to update
      - in: path
        name: variantSetId
        description: The ID of the variant to be updated (must already exist)
      responses:
        200:
          description: OK
      tags:
      - Variant Set
  /v1/variantsets/{variantSetId}:export:
    post:
      summary: Export Variant Set
      description: Exports variant set data to an external destination
      operationId: genomics.variantsets.export
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: variantSetId
        description: Required
      responses:
        200:
          description: OK
      tags:
      - Variant Set
  /v1/{name}:
    get:
      summary: Get Operation
      description: Gets the latest state of a long-running operation
      operationId: genomics.operations.get
      parameters:
      - in: path
        name: name
        description: The name of the operation resource
      responses:
        200:
          description: OK
      tags:
      - Operation
  /v1/{name}:cancel:
    post:
      summary: Cancel Operation
      description: Starts asynchronous cancellation on a long-running operation
      operationId: genomics.operations.cancel
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: name
        description: The name of the operation resource to be cancelled
      responses:
        200:
          description: OK
      tags:
      - Operation
  /v1/{resource}:getIamPolicy:
    post:
      summary: Get IAM Policy
      description: Gets the access control policy for the dataset
      operationId: genomics.datasets.getIamPolicy
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: resource
        description: 'REQUIRED: The resource for which policy is being specified'
      responses:
        200:
          description: OK
      tags:
      - IAM
  /v1/{resource}:setIamPolicy:
    post:
      summary: Set IAM Policy
      description: Sets the access control policy on the specified dataset
      operationId: genomics.datasets.setIamPolicy
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: resource
        description: 'REQUIRED: The resource for which policy is being specified'
      responses:
        200:
          description: OK
      tags:
      - IAM
  /v1/{resource}:testIamPermissions:
    post:
      summary: Test IAM Permissions
      description: Returns permissions that a caller has on the specified resource
      operationId: genomics.datasets.testIamPermissions
      parameters:
      - in: body
        name: body
        schema:
          $ref: '#/definitions/holder'
      - in: path
        name: resource
        description: 'REQUIRED: The resource for which policy is being specified'
      responses:
        200:
          description: OK
      tags:
      - IAM
